import React from "react";
import Login from "./scenes/LoginPage/Login";
import {BrowserRouter, Routes, Rouet} from "react-router-dom";

function App() {
  return(
    <BrowserRouter>
      <Route path = "/login" element = {<Login />}></Route>      
    </BrowserRouter>
  );
}

export default App;
